import React from "react"

const PageNumberSelector = ({ isPackagePDFs, setIsPackagePDFs }) => {
  return (
    <div className="text-input-container">
      <label className="selector-label">Show Page Numbers?</label>
      <div>
        <div className="button-group-package">
          <button
            onClick={() => setIsPackagePDFs(false)}
            className={!isPackagePDFs ? "selected" : ""}
          >
            No
          </button>
          <button
            onClick={() => setIsPackagePDFs(true)}
            className={isPackagePDFs ? "selected" : ""}
          >
            Yes
          </button>
        </div>
      </div>
    </div>
  )
}

export default PageNumberSelector
